On the promontory overlooking the Trousdale Estates and high above the famed Sunset Strip with views from downtown Los Angeles and the snow-capped mountains beyond, to the Getty Center, Santa Monica, Catalina Island, and the Pacific Ocean, is Gilcrest Drive. -

Sold & Listed By:
@williamsandwilliams

@DarrenCurtis_Christies offering this AUD $16,500,000 architectural masterpiece in Sydney's prestigious suburb of Castle Cove.

Cocooned in a peaceful and private bay side pocket, this visionary home fits as one with the landscape. An inspired collaboration between Terroir Architects, interior designer Pascale Gomes-McNabb and the owners. It rests on a N/E facing gated and completely private 5300sqm approx adjoining reserve and set in designer gardens. The home has been constructed of concrete utilising its sculptural qualities to recess it into the landscape. The concrete is paired in formed steel, reflective surfaces and an abundance of handcrafted timber joinery. Lift access, living level with substantial dining, family room and soundproofed fitted out home theatre. Chef's commercial inspired marble and stainless kitchen, finest appliances, large butler's pantry. Luxury bedroom suites, handcrafted cabinetry, robes, built-in desks, separate guest suite with ensuite. Superb master wing with Japanese inspired indoor/outdoor bathroom, home office, hydronic heating. Resort style heated ozone pool, full size flood lit tennis court, brand new studio/office plus 4 car garage. 6 visitor car spaces, 60000L rainwater tanks, walk to the bus, bay and golf, close to schools and Chatswood.

Contact @darrencurtis_christies for more information
